def B_lin(q=None,qd=None,p=None,u=None):
    """ Linear mass matrix 
    q:  degrees of freedom at operating point, array-like: ['x(t)', 'y(t)', 'phi_x(t)', 'phi_y(t)', 'phi_z(t)', 'q_T1(t)', 'psi(t)']
    qd: dof velocities at operating point, array-like
    p:  parameters, dictionary with keys: ['L_T', 'tilt', 'v_yT1c', 'x_NR', 'z_NR']
    u:  inputs at operating point, dictionary with keys: []
           where each values is a constant!
    The columns of B correspond to:   [T_a(t)]\\ 
    """
    BB = np.zeros((7,1))
    BB[0,0] = (-p['v_yT1c']*q[5]*sin(q[3])+cos(q[3])*cos(q[4]))*cos(p['tilt'])+(-p['v_yT1c']*q[5]*cos(q[3])*cos(q[4])-sin(q[3]))*sin(p['tilt'])
    BB[1,0] = (-p['v_yT1c']*(sin(q[2])*sin(q[3])*cos(q[4])+sin(q[4])*cos(q[2]))*q[5]+sin(q[2])*cos(q[3]))*sin(p['tilt'])+(p['v_yT1c']*q[5]*sin(q[2])*cos(q[3])+sin(q[2])*sin(q[3])*cos(q[4])+sin(q[4])*cos(q[2]))*cos(p['tilt'])
    BB[2,0] = -p['L_T']*(-p['v_yT1c']*q[5]*sin(p['tilt'])+cos(p['tilt']))*sin(q[4])*cos(q[3])-p['x_NR']*sin(p['tilt'])*sin(q[4])*cos(q[3])-p['z_NR']*sin(q[4])*cos(p['tilt'])*cos(q[3])+(-p['v_yT1c']*q[5]*cos(p['tilt'])-sin(p['tilt']))*q[5]*sin(q[4])*cos(q[3])
    BB[3,0] = p['L_T']*(-p['v_yT1c']*q[5]*sin(p['tilt'])+cos(p['tilt']))*cos(q[4])+p['x_NR']*sin(p['tilt'])*cos(q[4])+p['z_NR']*cos(p['tilt'])*cos(q[4])-(-p['v_yT1c']*q[5]*cos(p['tilt'])-sin(p['tilt']))*q[5]*cos(q[4])
    BB[4,0] = 0
    BB[5,0] = p['v_yT1c']*p['x_NR']*sin(p['tilt'])+p['v_yT1c']*p['z_NR']*cos(p['tilt'])-p['v_yT1c']*q[5]*sin(p['tilt'])+cos(p['tilt'])
    BB[6,0] = 0
    return BB

